★ミストラルのスノーボードジャケット！<br>
<br>
●耐水圧10,000mm！防水性＋透湿性に優れた素材！雨風の侵入を防ぎ、快適なコンディションを持続的にキープする『防水加工素材』！<br>
●両脇下にはウェア内の温度や湿気を調節できるベンチレーション付き。<br>
●両サイドにジッパーポケット、両胸にベルクロポケット。左袖には収納可能なパスケース付き。<br>
●内部左にメッシュポケット、右にジッパーポケット。<br>
●袖先は、リストゲーター付きで雪の浸入をしっかりガード！<br>
●裾の内側に付いているパウダーガードで雪の侵入を防ぎます！<br>
●個性的なレイヤードデザイン！<br>
<br>
■素材 ポリエステル100％<br>
<br>
