★グラバークリークのボードジャケット！<br>
<br>
●耐水圧5,000mm！防水性＋透湿性に優れた素材！雨風の侵入を防ぎ、快適なコンディションを持続的にキープする『防水加工素材』！<br>
●アジャスターコードが前後に付いたフードは防寒性の高い二重構造！<br>
●両サイド、左袖にジッパーポケット、裾にドローコード付き。<br>
●両脇下にはウェア内の温度や湿気を調節できるベンチレーション付き。<br>
●ハンドカフス付きで袖口からの雪の浸入をしっかりガード。腰にも雪の侵入を防ぐパウダーガード！<br>
●内側にはメッシュポケット、イヤフォンホールつきのジッパーポケット付き。ゴーグルや携帯電話、無線機など収納可能です。<br>
●内側左裾にパスケース付き。ジャケット内に収納出来ます！<br>
●背中側は裏起毛素材を使用！<br>
<br>
■素材 ポリエステル100％<br>
